    static void PrintLargestAreaOfPassableCells(char[,] mat, char p, char s)
    {
        // Method to print largest area of passable cells in given matrix

        // Parameters:
        // p = passable cell character
        // s = searched cell character

        int rows = mat.GetLength(0);
        int cols = mat.GetLength(1);
        char[,] mTemp = new char[rows,cols];
        char[,] cTemp = new char[rows,cols];
        char[,] maxArea = new char[rows,cols];

        CopyValues(mTemp, mat); // Copy values of mat to mTemp
        CopyValues(cTemp, mat); // Copy values of mat to cTemp
        CopyValues(maxArea, mat); // Copy values of mat to maxArea

        int maxCount = -1;

        for(int r = 0; r < rows; r++)
        {
            for(int c = 0; c < cols; c++)
            {
                int count = 0;
                if(mTemp[r,c] == p)
                {
                    count = FindArea(r, c, cTemp, mTemp, p, s);
                    if(count > maxCount)
                    {
                        maxCount = count;
                        CopyValues(maxArea, cTemp); // Copy values of cTemp to maxArea
                        CopyValues(cTemp, mat); // Copy values of mat to cTemp
                    }
                }
            }
        }

        Console.WriteLine($"Max area: {maxCount}");
        PrintMatrix(maxArea);
    }


    static int FindArea(int r, int c, char[,] cTemp, char[,] mTemp, char p, char s, int count=0)
    {
        // Method to return area count of passable cells starting from cell[r,c]

        if(r < 0 || c < 0 || r >= cTemp.GetLength(0) || c >= cTemp.GetLength(1) || cTemp[r,c] != p)
        {
            return count;
        }

        cTemp[r,c] = mTemp[r,c] = s; // Mark current cell as searched
        count += 1;

        count = FindArea(r, c+1, cTemp, mTemp, p, s, count); // search right
        count = FindArea(r+1, c, cTemp, mTemp, p, s, count); // search down
        count = FindArea(r, c-1, cTemp, mTemp, p, s, count); // search left
        count = FindArea(r-1, c, cTemp, mTemp, p, s, count); // search up

        return count;
    }


    static void CopyValues(char[,] to, char[,] from)
    {
        // Method to copy values form matrix to to matrix
        // They should have same dimensions

        for(int r = 0; r < from.GetLength(0); r++)
        {
            for(int c = 0; c < from.GetLength(1); c++)
            {
                to[r,c] = from[r,c];
            }
        }
    }


    static void PrintMatrix(char[,] mat)
    {
        // Method to print given matrix

        for(int r = 0; r < mat.GetLength(0); r++)
        {
            for(int c = 0; c < mat.GetLength(1); c++)
            {
                Console.Write(mat[r,c]);
            }

            Console.WriteLine();
        }
    }
